from sympy import factorint
def a(n):
    k = 0
    while n != 5:
        n, k = sum(p+e for p, e in factorint(n).items()), k + 1
    return k
print([a(n) for n in range(5, 118)]) # _Michael S. Branicky_, Sep 08 2025

